import React from 'react';
import Logo from '../../Assets/Logo/OriginalLogo.png';

function LandingPage () {
    return (
        <>
            <div>
                <img src={Logo} alt=""/>

            </div>
            <div>
                <h2>Quick Search</h2>
                <button>Toronto</button>
            </div>
        </>
    )
}

export default LandingPage;
